import './FooterOffer.scss';

function FooterOffer() {
    return (
        <div className="footer__offer">
            <div className="footer__offer-container">
                <span>
                    Информация предоставленная на сайте не&nbsp;является публичной офертой © 2019-2023
                </span>
            </div>
        </div>
    );
  }

  export default FooterOffer;
